import React from 'react';

const PitchPage: React.FC = () => {
  return (
    <div style={{ padding: '2rem', textAlign: 'center' }}>
      <h1 style={{ color: '#60a5fa' }}>For Partners & Customers</h1>
      <p>Tailored pitch content coming soon...</p>
    </div>
  );
};

export default PitchPage;
